import React, { Component } from "react";
import { View, ScrollView } from "react-native";
// import HomeCategory from "../components/HomeCategory";

class App extends Component {
  render() {
    return (
      <View
        style={{
          flex: 1
        }}
      >
        <ScrollView scrollEnabled>
          <HomeCategory
            imageUri={require("../../assets/women_fashion.jpg")}
            titleFirst="Womens"
            titleSecond="Fashion"
            subTitle="Spring Season. Opened!"
            screenProps="Super"
            {...this.props}
          />
          <HomeCategory
            imageUri={require("../../assets/men_fashion.jpeg")}
            titleFirst="Mens"
            titleSecond="Fashion"
            subTitle="Pure. Old Fashioned."
            {...this.props}
          />
          <HomeCategory
            imageUri={require("../../assets/kids_fashion.jpg")}
            titleFirst="Kids"
            titleSecond="Fashion"
            subTitle="For the smallest."
            {...this.props}
          />
        </ScrollView>
      </View>
    );
  }
}

export default App;
